  ?pub dblp:authoredBy <https://dblp.org/pid/121/9027> ; dblp:authoredBy <https://dblp.org/pid/04/4347> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/conf/emisa/SimonD04> dblp:authoredBy ?author .
  <https://dblp.org/rec/conf/isaac/Farach-ColtonT15> dblp:authoredBy ?author
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?author ) AS ?count ) WHERE {
  <https://dblp.org/rec/journals/jimaging/MorigiA22> dblp:authoredBy | dblp:createdBy ?author .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?title WHERE {
  VALUES ?author {
    <https://dblp.org/pid/11/4677> <https://dblp.org/pid/27/7304>
  }
  ?pub dblp:authoredBy ?author ; dblp:title ?title .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  VALUES ?author {
    <https://dblp.org/pid/200/1392> <https://dblp.org/pid/200/1410> <https://dblp.org/pid/263/4418> <https://dblp.org/pid/50/11526>
  }
  <https://dblp.org/rec/conf/igarss/ImperatorePL18> dblp:authoredBy | dblp:createdBy ?author
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author ?primaryAffiliation WHERE {
  VALUES ?author {
    <https://dblp.org/pid/66/4324> <https://dblp.org/pid/75/5430>
  }
  ?author dblp:primaryAffiliation ?primaryAffiliation
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?count ) WHERE {
  VALUES ?author {
    <https://dblp.org/pid/137/7919> <https://dblp.org/pid/194/4633> <https://dblp.org/pid/223/1801> <https://dblp.org/pid/23/10193> <https://dblp.org/pid/269/0284> <https://dblp.org/pid/269/0753> <https://dblp.org/pid/269/0855> <https://dblp.org/pid/269/1340>
  }
  ?pub dblp:authoredBy ?author ; dblp:publishedInStream <https://dblp.org/streams/journals/ploscb> .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?title ?stream ?streamLabel WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/conf/IEEEscc/PuXL08> <https://dblp.org/rec/conf/icchp/SaifF16>
  }
  ?pub dblp:title ?title ; dblp:publishedInStream ?stream .
  OPTIONAL {
    ?stream rdfs:label ?streamLabel
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( ?pub ) AS ?count ) WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/04/2926>
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?year WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/books/daglib/0031968> <https://dblp.org/rec/journals/coling/Rijsbergen06> <https://dblp.org/rec/conf/smc/MahmoudKRA10>
  }
  ?pub dblp:yearOfPublication ?year
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/conf/flairs/AriouaC16> dblp:authoredBy | dblp:createdBy <https://dblp.org/pid/31/4430>
